|| TO_CLOB(q'[);">텀블업은&nbsp;<a href="https://help.tumblbug.com/hc/ko/articles/360052346633" target="_self" style="box-sizing: border-box; color: rgb(39, 163, 255); text-decoration: none;">프로젝트 공개검토 기준</a>에 따라 모든 프로젝트를 심사하고 있습니다. 창작자가 자신의 아이디어와 계획과 예산 등을 충실히 기재하였는지, 진행 과정에서 예측 가능한 문제는 없는지, 창작자로서의 필수 요건을 충족하는지 등을 중심으로 확인합니다.&nbsp;</p><p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; backg]')
