Insert into FAQ (ID,TITLE,CONTENT,DATE_CREATED,DATE_UPDATED,IS_DELETED,MEMBER_ID) values (1007,'선물은 무엇인가요?',TO_CLOB(q'[<p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">선물 또는 리워드는 말 그대로 개별 후원에 대해 프로젝트의 창작자가 제공하는 선물입니다. 모든 창작자는 사전 후원자들의 기여도에 따라 돌려받을 수 있는 선물을 구성해두고 있습니다. 표면적으로는 후원에 대한 보답으로 그치는 것 같지만, 사실 창작자의 입장에서 이것은 프로젝트를 통해 만들어질 것의 최소한의 수요(사용자, 관객 등)를 확보할 수 있도록 마련된 기능이기도 합니다.</p><h4 id="55" style="box-sizing: border-box; font-family: -apple-system, Bl]')
|| TO_CLOB(q'[inkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; margin-top: 0px; font-size: 16px; color: rgb(61, 61, 61); background-color: rgb(255, 255, 255);"><span class="wysiwyg-font-size-large" style="box-sizing: border-box; font-size: large;">최소 수요를 확보한다고요? 좀 더 자세히 설명해주세요.</span></h4><p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 2]')
|| TO_CLOB(q'[55, 255);">조금 가벼운 비유를 하자면 텀블벅은 완성되지 않은 컨셉들과 프로토타입을 위한 시장이라고 볼 수도 있습니다. 여러분이 프로젝트를 통해 만들어질 독특한 무언가를 선물로 약속한다면, 사실상 그것은 여러분 프로젝트의 최초 수요자를 확보하는 것이나 다름없습니다. 생각해보면 이것은 대단히 중요한 부분입니다.<br style="box-sizing: border-box;"><br style="box-sizing: border-box;">왜냐하면, 전통적인 방식에선 제작과 유통이 별개의 문제였고 대다수의 독립 창작자들이 작업에 드는 비용을 감당하거나 지원금을 받아 가까스로 작업을 완성해놓고도 최소한의 수요를 확보하지 못해 뿌린 만큼 거두지 못하는 경우가 대부분이기 때문입니다. 기꺼이 리스크를 감수하는 창작의 특성상 어쩔 수 없는 것이라 하더라도, 이런 상황이 반복된다면 대다수의 창작자의 사정은 어려워질 수밖에 없습니다. 만들어질 작품(또는 창작물)을 소비할 최초 수요를 확보한다는]')
|| TO_CLOB(q'[ 관점에도 후원자 선물은 매우 핵심적인 기능을 합니다.</p><h4 id="56" style="box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; margin-top: 0px; font-size: 16px; color: rgb(61, 61, 61); background-color: rgb(255, 255, 255);"><strong style="box-sizing: border-box;"><span class="wysiwyg-font-size-large" style="box-sizing: border-box; font-size: large;">하지만 그렇게 듣자니 마치 장사를 하는 것 같군요.</span></strong></h4><p style="box-sizing: border-box; color: rgb(61, ]')
|| TO_CLOB(q'[61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">중요한 포인트입니다. 재차 강조하지만, 텀블업은 단지 감정에 호소해 기금을 모집하는 플랫폼이 아니라 어느 정도 시장 법칙에 호응하는 펀딩 플랫폼입니다. 다시 말해 리스크를 감당할 만큼 충분한 수요와 공감대가 있어야 프로젝트를 실행한다는 것입니다. 특히 독립 영화, 출판, 공연처럼 응용예술과 이벤트 분야에서 이것은 매우 중요한 문제지요. 대부분의 사람이 수요도 파악할 수 없는 불확실성과 싸우며 매번 리스크를 감당하고 있으니까요.</p><p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, Blink]')
|| TO_CLOB(q'[MacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">다만 모든 프로젝트에 시장성이 적용된다는 것은 아닙니다. 어디까지나 특성일 뿐 우리가 추구하는 부분도 아닙니다.</p><h4 id="57" style="box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; margin-top: 0px; font-size: 16px; color: rgb(61, 61, 61); background-color: rgb(255, 255, 255);"><strong style="box-sizing: border-box;"><span class="wysiwyg-font-size-]')
|| TO_CLOB(q'[large" style="box-sizing: border-box; font-size: large;">선물은 누가 만드나요?</span></strong></h4><p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">선물은 프로젝트 창작자가 직접 제작하고 후원자에게 전달하는 것입니다.<br style="box-sizing: border-box;">프로젝트에 후원해주신 것에 대한 창작자의&nbsp;'감사 표현'이라는 기본에 충실하면서 프로젝트의 창작자만이 줄 수 있는 독특한 결과물을 제시할 수 있다면 매력적인 선물이 될 것입니다. 어떤 것을 선물로 제공해야 할 지]')
|| TO_CLOB(q'[ 고민되신다면 아래 가이드를 참고해주세요.&nbsp;</p><ul style="box-sizing: border-box; list-style-position: outside; list-style-image: initial; margin: 20px 0px 20px 20px; padding: 0px 0px 0px 20px; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);"><li style="box-sizing: border-box; padding: 3px 0px;"><a href="https://help.tumblbug.com/hc/ko/articles/115006302567" target="_self" style="]')
|| TO_CLOB(q'[box-sizing: border-box; color: rgb(39, 163, 255); text-decoration: none;">어떤 것을 후원 선물로 제안해야 할까요?&nbsp;</a></li></ul>]'),to_date('21/04/27','RR/MM/DD'),to_date('21/04/27','RR/MM/DD'),'N',1);
