Insert into FAQ (ID,TITLE,CONTENT,DATE_CREATED,DATE_UPDATED,IS_DELETED,MEMBER_ID) values (1002,'프로젝트 밀어주기가 무엇인가요?',TO_CLOB(q'[<p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">프로젝트 밀어주기는 창작자들이 구상하는 프로젝트가&nbsp;실제로 현실이 될 수 있도록 일정한 금액을 지불하여 돕는 것입니다. 창작자를 향한 지지와 도움은 물론, 프로젝트를 통해 만들어지는 선물을 받아보시게 됩니다.</p><p style="box-sizing: border-box; color: rgb(61, 61, 61); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font]')
